import React from 'react';
import './App.css';
import ProjectView from "./components/ProjectView";

class App extends React.Component {
    getProject(e) {
        const project = e.target.innerText;
        console.log('E', project);
        if (project.includes('eaturveg')) return (
            <div className="Project">
                <h1>eaturveg</h1>
            </div>);
        else if (project.includes('spotify')) return (
            <div className="Project">
                <h1>spotify</h1>
            </div>);
        else if (project.includes('Filmotography')) return (
            <div className="Project">
                <h1>filmotography</h1>
            </div>);
        else return (
                <div className="Project">
                    <p className="home">
                        Hi, welcome to my projects blog.<br/>
                        <small>Select one from the left.</small>
                    </p>
                </div>
            );
    }

    render() {
        return (
            <div className="App">
                <div className="navigation">
                    <ul>
                        <h1>Projects:</h1>
                        <li>
                            <button className="project-button" onClick={this.getProject}>eaturveg</button>
                        </li>
                        <li>
                            <button className="project-button" onClick={this.getProject}>Spotify Recently
                                Added
                            </button>
                        </li>
                        <li>
                            <button className="project-button" onClick={this.getProject}>Filmotography
                            </button>
                        </li>
                    </ul>
                </div>
                <div className="content">
                    {this.getProject}
                </div>
            </div>
        );
    }
}

export default App;
